import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, NavbarBrand, NavItem, NavLink } from 'reactstrap';
import { Link } from 'react-router-dom';
import BG from '../svg/BG.svg'

export function NavBar(){
    const logo: string = require("../svg/Favicon.svg").default;
    const BG2: string = require("../svg/BG.svg").default;
    return (
    <>                      
        <header>
            <Navbar className="navbar-expand-lg fixed-top navbarBg" container light>
                <NavbarBrand tag={Link} to="/" className="text-white"><svg className='Favicon' width={150} height={100}/></NavbarBrand>
                <div className="flex-grow-1">
                    <ul className="navbar-nav mr-auto mt-2 mt-lg-0">
                        <NavItem>
                            <NavLink tag={Link} className="text-white" to="/">Магазин</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink tag={Link} className="text-white" to="/Test">Продукты</NavLink>
                        </NavItem>
                    </ul>
                </div>
                <div className="flex-grow-2">
                        <NavLink tag={Link} className="text-white" to="/Account">Корзина</NavLink>
                </div>  
            </Navbar>
        </header>
        </>
        )
}
